import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../utils/AuthContext';

export default function Header() {
  const navigate = useNavigate();
  const { user, logout, isAdmin, isSeller, isBuyer, getDefaultRoute } = useAuth();
  const [menuOpen, setMenuOpen] = useState(false);
  const [query, setQuery] = useState('');

  const dashboardLink = user ? getDefaultRoute(user.user_type) : '/dashboard';

  function onSearch(e) {
    e?.preventDefault();
    const q = query.trim();
    if (q) navigate(`/search?q=${encodeURIComponent(q)}`);
    else navigate('/'); // or stay
  }

  return (
    <header className="topbar navbar">
      <div className="navbar-container">
        <Link to="/" className="brand navbar-logo" aria-label="V·ªÅ trang ch·ªß">
          <span className="brand-name">V-Market</span>
        </Link>

        <form className="search-area" onSubmit={onSearch}>
          <input
            type="text"
            placeholder="T√¨m s·∫£n ph·∫©m, th∆∞∆°ng hi·ªáu..."
            value={query}
            onChange={(e) => setQuery(e.target.value)}
            className="search-input"
          />
          <button type="submit" className="search-btn">T√¨m</button>
        </form>

        <div className="actions navbar-menu">
          {user ? (
            <>
              <Link to={dashboardLink} className="navbar-link">
                {isAdmin ? 'üëë Admin' : isSeller ? 'üè™ Store' : 'üè† Home'}
              </Link>

              {isAdmin && <Link to="/users" className="navbar-link">Users</Link>}

              <Link to="/profile" className="navbar-link">Profile</Link>
              <Link to="/change-password" className="navbar-link">Password</Link>

              <div className="navbar-user">
                <button
                  className="user-btn"
                  onClick={() => setMenuOpen(!menuOpen)}
                  aria-haspopup="true"
                  aria-expanded={menuOpen}
                >
                  <img
                    src={user.avatar || '/default-avatar.png'}
                    alt={user.full_name || user.username}
                    className="user-avatar-img"
                  />
                </button>

                {menuOpen && (
                  <div className="user-menu show">
                    <Link to={dashboardLink} onClick={() => setMenuOpen(false)}>Dashboard</Link>
                    <Link to="/profile" onClick={() => setMenuOpen(false)}>Trang c√° nh√¢n</Link>
                    <button
                      onClick={() => {
                        logout();
                        setMenuOpen(false);
                      }}
                    >
                      ƒêƒÉng xu·∫•t
                    </button>
                  </div>
                )}

                <span className="user-badge">{user.user_type}</span>
                <span className="user-name">{user.username}</span>
              </div>
            </>
          ) : (
            <>
              <Link to="/login" className="navbar-link">Login</Link>
              <Link to="/register" className="navbar-link">Register</Link>
            </>
          )}

          <Link to="/cart" className="cart-btn" aria-label="Gi·ªè h√†ng">
            üõí<span className="cart-dot" />
          </Link>
        </div>
      </div>
    </header>
  );
}
